function escapeHtml(e){return String(e).replace(/&/g,"&amp;").replace(/</g,"&lt;").replace(/>/g,"&gt;")}function convert(e){var r=escapeHtml(e);return r=(r=(r=(r=r.replace(/\*\*(.+?)\*\*/g,"<strong>$1</strong>")).replace(/\*(.+?)\*/g,"<em>$1</em>")).replace(/`([^`]+)`/g,"<code>$1</code>")).replace(/\n/g,"<br>")}define(function(){return{convert:convert,escapeHtml:escapeHtml}});
